import Sms from '../assets/sms.svg'
import Footer from '../Footer'
import './Settings.css'

const SettingsPanel = () =>{
    return(
        <>
			<h4 className='pagetitle'><b>Contacts</b></h4>

			<div className='page_greeting'>
			<h2>Business Number</h2>
			<h2>12345672345<img style={{marginLeft:'4px'}} id='waveIcon' src={Sms} alt='wave'></img></h2>
			</div>


        <Footer />
        </>

    )
}


export default SettingsPanel;
